import React, { Component } from "react";

class Info extends Component {
  render() {
    return (
      <React.Fragment>
        <h3 className="user-deets">
          <a href={this.props.user.twitterUsername}>{this.props.user.name}</a>
        </h3>
        <div className="user-deets">Location</div>
        <div className="user-deets">{this.props.user.location}</div>
        <div className="user-deets">Eats</div>
        <div className="user-deets">{this.props.user.foodType}</div>
        <div className="user-deets">Age</div>
        <div className="user-deets">{this.props.user.age}</div>
        <div className="user-deets">Likes</div>
        <div className="user-deets">{this.props.user.likes}</div>
        <div className="user-deets">Location</div>
        <div className="user-deets">{this.props.user.location}</div>
      </React.Fragment>
    );
  }
}

export default Info;
